import { Button } from "bootstrap";
import React from "react";
import { Form } from "react-bootstrap";
import "./InitialDisplay.css";

const InitalDisplay = () => {
  return (
    <div className="app-container">
      <div className="init-subtitle1">TFGRINDER</div>
      <Form className="init-form">
        <Form.Group controlId="exampleForm.ControlTextarea1">
          <Form.Label className="init-subtitle2">Enter Username</Form.Label>
          <Form.Control
            as="textarea"
            size="lg"
            rows={1}
            className="username-input"
            maxlength="16"
          />
        </Form.Group>
        <Button variant="light" size="lg" className="button-text">
          Submit
        </Button>
      </Form>
    </div>
  );
};

export default InitalDisplay;
